              $activeCoinTab === 9 ? defaults.slice(3,8) : 
              $activeCoinTab === 10 ? defaults.slice(1,7) : defaults

  $: sortedTokens = sortCoins($selectedField, tokens, $asc)

  let resolved = false;
  $page.data.market.then(x => {resolved = true, defaults=x} ).catch(x => resolved = true)
</script>

<div class="w-full mb-24">
  {#if !resolved}
    <!-- Loading -->
    {#each Array(12) as i}
      <SingleTokenLoader />
    {/each} 
  {:else} 
    <!-- Success -->
    <table class="table w-full">
      <TableColumns />

      <tbody>
        {#each sortedTokens as token}
          <SingleToken token={token} />
        {/each}
      </tbody>
    </table>

